import React, {Component} from 'react';


class Nav extends Component {
    render(){
        return (
            <nav className="container">
                <ul>
                    <li>Logo</li>
                    <li>Home</li>
                    <li>Events</li>
                    <li>Organising Committe</li>
                    <li>Previous Sponsors</li>
                    <li>Contact Us</li>
                </ul>
            </nav>
        );
    }
}
export default Nav;
